prompt Creating POSITIONS...
create table POSITIONS
(
  positionsid   NUMBER(38) not null,
  positionsname VARCHAR2(255) not null,
  requirements  VARCHAR2(600) not null
)
tablespace SYSTEM
  pctfree 10
  pctused 40
  initrans 1
  maxtrans 255
  storage
  (
    initial 64K
    next 1M
    minextents 1
    maxextents unlimited
  );
